DISPLAY: Tela de LCD (monocromática ou colorida) de no mínimo 2.8 polegadas, com exibição de dados em tempo real e ajustes em português do Brasil;
VELOCIDADE/TAXA DE INFUSÃO: Faixa ajuste de 0,1 mL/H a 1.800 mL/H com resolução mínima de 0,1 mL/H;
PRECISÃO DE TAXA DE FLUXO: Mínimo de 5% (com equipos comuns) ou 3% com equipo recomendado pelo fabricante;
VOLUME A SER ADMINISTRADO (VTBI): Faixa de 0,1 mL a 9.999 mL com resolução de 0,1 mL;
PRESSÃO DE BLOQUEIO/OCLUSÃO: Três níveis ajustáveis (alto, médio, baixo), com indicação da pressão;
